import React from 'react'
import why from "./Todolist";

export default function Todolist() {
    return (
        <div>
            <ul>
                <li> this is one</li>
                <li> this is two</li>
                <li> this is three</li>
                <li> this is four</li>
                <li> this is five</li>
            
            </ul>
        </div>
    )
}

function Why() {
    return (
         <p> i am cool para from Why.... </p>
    )
}
